import React, { useEffect, useState } from "react";

export default function Ticker() {
  const [update, setUpdate] = useState(0);

  useEffect(() => {
    setInterval(function () {
      getData;
    }, 1000);
  }, [update]);

  function getData() {
    setUpdate((prev) => prev + 1);
  }

  return (
    <div className="card">
      <div className="cardContainer"></div>
      <div className="right">
        <h6>High 24h</h6>
        <h2 className="red">$2044.2373</h2>
        <h6>Low 24h</h6>
        <h2 className="green">$1984.2865</h2>
      </div>
      <div className="left">
        <span className="title">Etheruem Live Stats</span>
        <p className="live-icon"></p>
        <h1 className="red">$2301.2323</h1>
        <h4 className="red">0.0362%</h4>
      </div>
    </div>
  );
}
